  .post('/auth')
  .send(extract(User, ['username', 'password']))
  .end((error, response) => {
    if (error) {
      return done(new Error(error));
    }
    expect(response.statusCode).to.equal(200);
    expect(response).to.have.cookie('session');
    done();
  });

